class AutRouter:    route_app_labels = {'auth', 'contenttypes', 'admin', 'sessions'}        def db_for_read( self, model, **hints):        if model._meta.app_label in self.route_app_labels:            return 'user_db'        return None    def db_for_write( self, model, **hints):        if model._meta.app_label in self.route_app_labels:            return 'user_db'        return None        def db_for_relation( self, obj1, obj2, **hints):        if (            obj1.model._meta.app_lable in self.route_app_labels or            obj2.model._meta.app_lable in self.route_app_labels        ):            return True        return None    def db_for_migrate( self, db, app_label, model_name = None, **hints ):        if app_label in self.route_app_labels:            return db == 'user_db'        return Noneclass UserRouter:    route_app_labels = {'user'}        def db_for_read( self, model, **hints ):        if model._meta.app_label in self.route_app_labels:            return 'users_db'        return None        def db_for_write( self, model, **hints ):        if model._meta.app_label in self.route_app_labels:            return 'users_db'        return None        def db_for_relation( self, obj1, obj2, **hints ):        if (                obj1.model._meta.app_lable in self.route_app_labels or                obj2.model._meta.app_lable in self.route_app_labels        ):            return True        return None        def db_for_migrate( self, db, app_label, model_name = None, **hints ):        if app_label in self.route_app_labels:            return db == 'users_db'        return Noneclass StudentRouter:    route_app_labels = {'student'}        def db_for_read( self, model, **hints ):        if model._meta.app_label in self.route_app_labels:            return 'student_db'        return None        def db_for_write( self, model, **hints ):        if model._meta.app_label in self.route_app_labels:            return 